import React from 'react'
import { Switch, Route } from 'react-router-dom'

import SignIn from '../pages/Auth/signIn'
//import SignUp from '../pages/Auth/signUp';

export default function Routes(){
    return(
        <Switch>
            <Route path="/" exact component={SignIn} />            
        </Switch>
    );
}
